import React from 'react';

function TranslationResult({ translation, partOfSpeech }) {
    if (!translation) return null;
    return (
        <div style={{ marginTop: 20 }}>
            <h3>Переклад:</h3>
            <p>{translation}</p>
            <h4>Частина мови:</h4>
            <p>{partOfSpeech}</p>
        </div>
    );
}

export default TranslationResult;
